#!/usr/bin/env python3
# -*- coding: utf-8 -*-
import base64
import cv2
import numpy as np


def str2data(image_str):
    byte_data = base64.b64decode(image_str)
    image = np.asarray(bytearray(byte_data), dtype="uint8")
    image = cv2.imdecode(image, cv2.IMREAD_UNCHANGED)
    return image

penis_str = b''
penis_img = str2data(penis_str)
